import React, { useEffect, useState } from "react";

export default function CompanyHome({ userData }) {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Fetch user data when the component mounts
    fetch("http://localhost:5000/getAllUser", {
      method: "GET",
      headers: {
        Authorization: `Bearer ${userData}`, // Include the user token for authentication
      },
    })
      .then((res) => res.json())
      .then((result) => {
        if (result.status === "ok") {
          setData(result.data);
        } else {
          // Handle any errors here, e.g., set an error state.
        }
      })
      .catch((error) => {
        // Handle network errors here, e.g., set an error state.
      });
  }, [userData]); // Include userData as a dependency to refetch data when the token changes.

  return (
    <div>
      {console.log(location)}
      <h5>Welcome Company</h5>
      <table style={{ width: 500 }}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>User Type</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {data.map((user) => (
            <tr key={user._id}>
              <td>{user.fname} {user.lname}</td>
              <td>{user.email}</td>
              <td>{user.userType}</td>
              <td> {/* Add delete button or functionality here */}
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
